import { render } from '@testing-library/react'
import React, { Component } from 'react'
import {Route, Link, Switch, Redirect} from 'react-router-dom'
import './MyOrders.css'

export default class MyOrders extends Component{
    constructor(){
        super()
    }

render(){
    // console.log(this.props.orders)
    let reverse = this.props.orders.reverse();
    console.log(reverse)
    let orderlist = reverse.map((order, index)=>{
        let date = order.createdAt.substring(0,10)
        let time = order.createdAt.substring(19,17)
        let hour = (parseFloat(order.createdAt.substring(19,11)))-6
        let minute = parseFloat(order.createdAt.substring(19,14))
        let seconds = parseFloat(order.createdAt.substring(19,17))
        let ampm = ''
        if(hour<12){
            ampm = 'AM'
        }else{
            ampm = 'PM'
        }

        console.log(time);
        return(
            <div className='orderdiv'>
                <p>{order.item}</p>
                <p>${order.price}</p>
                <p>{hour}:{minute}.{seconds}{ampm} {date}</p>
            </div>
        )
    })
    return(
        <div className='orderlist'>
            <h1>ORDERS</h1>
            {orderlist}
        </div>
    )
}
}
